Let's think step by step. $2*x/sin x$ is $(\boxed{2*x})/(\sin x)$. We can use the trigonometric identity $sin x = \boxed{1/2*x}$. Then, we substitute $sin x = 1/2*x$ and $x = 1ft$ to get:

$$\boxed{(1/2*1ft) = 1ft}
\boxed{1/2*1 = 1}
$$

Therefore, we can answer the question: $(1/2*1) = 1. The answer is: 1.
